const CACHE_NAME="wildlife-pwa-cache-v1",urlsToCache=["/","/index.html","/manifest.json","/icon-192.png","/icon-512.png"];self.addEventListener("install",e=>{e.waitUntil(caches.open(CACHE_NAME).then(e=>e.addAll(urlsToCache)))}),self.addEventListener("fetch",e=>{e.respondWith(caches.match(e.request).then(n=>n||fetch(e.request)))});